import React, { useState } from 'react'
import TextField from '@mui/material/TextField'
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';

const Login = () => {
    const [Username, setUsername] = useState('')
    const [Password, setPassword] = useState('')
    return (
        <div className='w-full h-full text-center'>
            <h1 className='text-indigo-900 text-3xl' style={{ paddingTop: '3rem' }}>Login to your account</h1>
            <form>
                <TextField
                    sx={{ m: 1, minWidth: 240 }}
                    label="Enter Username"
                    id="standard-size-normal"
                    variant="standard"
                    className='row text-left'
                    name='username'
                    onChange={(e) => setUsername(e.target.value)}
                />

                <TextField
                    sx={{ m: 1, minWidth: 240 }}
                    label="Enter Password"
                    id="standard-size-normal"
                    variant="standard"
                    className='row text-left'
                    name='password'
                    onChange={(e) => setUsername(e.target.value)}
                />

                <button type='submit' onClick className='w-1/3 bg-purple text-white col' style={{ marginTop: "0.8rem", marginRight: "5px", padding: '5px' }}>Add Transaction</button>
            </form>
        </div>
    )
}

export default Login
